import { BrowserRouter, Switch, Route } from "react-router-dom";
import { PartnersTable } from "./components/partners-table/partners-table";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { PartnerCreate } from './components/partner-create/partner-create';
import { PartnerScreenInfo } from "./components/partner-edit/partner-screen-info";



const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <PartnersTable />
        </Route>
        <Route exact path="/partner/:id"
        render={(routerProps) => {
          const partnerId = routerProps.match.params.id;

          return (
            <PartnerScreenInfo id={partnerId}/>
          );
          }} 
          />  
          <Route exact path="/partner-create/">
            <PartnerCreate/>
          </Route>


      </Switch>
    </BrowserRouter>
  );
};

export default App;
